import React,{} from 'react'
import Sidebar from './Sidebar'
import Buttons from './Buttons'
import './Addbasicdetails.css'
import {useNavigate} from 'react-router-dom'

function Addbasicdetailsemployee() {
    const navigate = useNavigate();
    const navigatetoAddemployee = () => {
        navigate("/Addemployee1");
      };
      const [password, setPassword] = useState('');

    
      const generatePassword = (event) => {
        event.preventDefault();
        const length = 20; // length of the generated password
        const characters = 'abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789!@#$%^&*()_+~`|}{[]\:;?><,./-=';
        let newPassword = '';
    
        for (let i = 0; i < length; i++) {
          const randomIndex = Math.floor(Math.random() * characters.length);
          newPassword += characters[randomIndex];
        }
    
        setPassword(newPassword);
      };
    
  return (
    <div id='main'>
    <Sidebar />
    <div className='basicdetail'>
      <div className='basicdetail-container'>
          <h4>General information</h4>
          <form>
              <div className='basicinput'>
                  <div>Name : <input type='text'/></div>
                  <div>Email : <input type='email'/></div>
                  <div className='password'><input type='text' name='password' placeholder='Password' value={password}/><button className='generatepassword' onClick={generatePassword}>Generate</button></div>
                    <div><button className='Basicbutton' onClick={navigatetoAddemployee}>Submit</button></div>
              </div>
          </form>
      </div>
    </div>
    <Buttons />
  </div>
  )
}

export default Addbasicdetailsemployee
